INSERT INTO `publikasis` (`id`, `judul`, `nomor_katalog`, `nomor_publikasi`, `issn_isbn`, `tanggal_rilis`, `deskripsi`, `created_at`, `updated_at`, `published_at`, `created_by_id`, `updated_by_id`) VALUES
	(1, 'Produk Domestik Regional Bruto Kabupaten Barru Menurut Pengeluaran 2019-2023', '9302020.7310', '73100.24005', '2797-5002', '2024-04-30', 'Produk Domestik Regional Bruto (PDRB) merupakan salah satu indikator ekonomi yang dapat digunakan untuk mengevaluasi kinerja pembangunan ekonomi suatu wilayah (provinsi maupun kabupaten/kota). Perangkat data PDRB dapat pula digunakan untuk kepentingan dan tujuan lain, seperti sebagai dasar pengembangan model-model ekonomi dalam rangka menyusun formulasi kebijakan, tingkat percepatan uang beredar (velocity of money), pendalaman sektor keuangan (finacial deepening), penetapan pajak, kajian ekspor dan impor dan sebagainya. Penghitungan PDRB dapat dilakukan melalui tiga pendekatan, yaitu : pendekatan produksi/penyediaan (PDRB menurut Lapangan Usaha/industry), pendekatan pengeluaran/permintaan akhir (PDRB menurut Pengeluaran /expenditure) serta pendekatan pendapatan (PDRB menurut pendapatan/income). Ketiga pendekatan penghitungan tersebut secara teori akan menghasilkan angka PDRB yang sama. Publikasi ini secara khusus membahas mengenai PDRB menurut pendekatan pengeluaran/permintaan akhir. Pendekatan ini dirinci menjadi beberapa komponen, yaitu: Pengeluaran Konsumsi Rumah Tangga, Pengeluaran Konsumsi Lembaga Non Profit yang Melayani Rumah Tangga, Pengeluaran Konsumsi Pemerintah, Investasi (Pembentukan Modal Tetap Bruto dan Perubahan Inventori), serta Ekspor Neto Antar Daerah (ekspor antar daerah dikurangi dengan impor antar daerah). Data PDRB dalam publikasi ini serta publikasi-publikasi selanjutnya mengunakan tahun dasar 2010, serta sudah menerapkan konsepSystem of National Accounts 2008seperti yang direkomendasikan olehUnited Nations.', '2024-05-28 00:57:26.748000', '2024-05-28 05:21:35.136000', '2024-05-28 00:59:31.347000', 1, 1),
	(2, 'Profil Industri Mikro dan Kecil Kabupaten Barru 2022', '6104006.7310', '73100.24006', '- ', '2024-04-29', 'Publikasi Profil Industri Mikro dan Kecil Kabupaten Barru 2022 menyajikan data hasil pelaksanaan Survei Industri Mikro dan Kecil (IMK) Tahun 2022 yang merupakan kegiatan rutin tahunan oleh Badan Pusat Statistik. Data yang disajikan dalam publikasi ini yaitu data banyaknya usaha industri pengolahan skala mikro dan kecil, tenaga kerja, balas jasa pekerja, pendapatan, permodalan, kesulitan usaha, pelayanan dan bimbingan usaha, serta distribusi pemasaran. Publikasi ini dilengkapi pula dengan ulasan singkat sehingga diharapkan pengguna data bisa lebih memahami data yang disajikan.\n', '2024-05-28 01:10:00.633000', '2024-05-28 01:50:21.074000', '2024-05-28 01:50:21.068000', 1, 1),
	(3, 'Produk Domestik Regional Bruto Kabupaten Barru Menurut Lapangan Usaha 2019-2023', '9302008.7310', '73100.24004', '2797-6211', '2024-04-04', 'Untuk keperluan perencanaan, evaluasi dan penentuan kebijakan pembangunan suatu daerah, dibutuhkan berbagai data statistik. Salah satu diantaranya adalah data Produk Domestik Regional Bruto (PDRB). Dalam rangka memenuhi kebutuhan data tersebut, BPS Kabupaten Barru telah menghitung PDRB tahun 2022 dengan angka konstannya menggunakan tahun dasar 2010.Diharapkan, publikasi ini akan banyak membantu berbagai pihak terutama Pemerintah Daerah Kabupaten Barru dan instansi lainnya maupun kalangan swasta, untuk perencanaan dan evaluasi pembangunan daerah Kabupaten Barru.\n', '2024-05-28 01:15:51.152000', '2024-05-28 01:49:35.876000', '2024-05-28 01:49:35.870000', 1, 1),
	(4, 'Kabupaten Barru Dalam Angka 2024', '1102001.7310', '73100.24003', '0215-6547', '2024-02-28', 'Kabupaten Barru Dalam Angka 2024 merupakan publikasi tahunan yang diterbitkan oleh BPS Kabupaten Kabupaten Barru. Publikasi ini menyajikan beragam jenis data yang bersumber dari BPS dan institusi lain. Terdapat beberapa data dalam pubikasi ini diantaranya gambaran umum tentang keadaan geografi dan iklim, pemerintahan, serta perkembangan sosial demografi dan perekonomian di Kabupaten Barru. Untuk menyamakan persepsi disertakan juga penjelasan teknis dari setiap jenis statistik yang disajikan.', '2024-05-28 01:18:40.727000', '2024-05-28 01:46:30.533000', '2024-05-28 01:46:30.528000', 1, 1),
	(5, 'Laporan Kinerja BPS Kabupaten Barru 2023', '1203012.7310', '73100.24002', '-', '2024-05-19', 'Laporan Kinerja BPS Kabupaten Barru 2023 merupakan wujud pertanggungjawaban dan akuntabilitas kinerja BPS Kabupaten Barru sebagai penyelenggara negara. Hal ini berguna untuk menciptakan transparansi kinerja BPS sehingga dapat menjaga kepercayaan masyarakat terhadap BPS. Di dalam laporan kinerja BPS 2023 tertuang hasil capaian kinerja BPS sepanjang tahun 2023. Hasil laporan ini diharapkan menjadi bahan evaluasi dan perbaikan untuk mencapai kinerja yang lebih optimal di tahun mendatang.\n', '2024-05-28 01:21:40.046000', '2024-05-28 01:48:09.806000', '2024-05-28 01:48:09.799000', 1, 1),
	(6, 'Indikator makro Sosial Ekonomi Kabupaten barru 2022', '9201012.7310', '73100.24001', '-', '2024-01-11', 'akro Sosial Ekonomi Kabupaten Barru Tahun 2021 merupakan sebuah publikasi yang meyajikan berbagai indikator yang menjadi potret kondisi social dan ekonomi di Kabupaten Barru di tahun 2021 dan perbandingannya dibeberapa tahun yang lalu secara makro. Adapun data yang tercakup dalam publikasi mengenai data kependudukan dan tenaga kerja, pembangunan manusia, PDRB dan pertumbuhan ekonomi serta kemiskinan, yang dikemas dalam bentuk grafik dan tabel yang memudahkan dalam penggunaannya.', '2024-05-28 01:25:13.555000', '2024-05-28 01:45:28.736000', '2024-05-28 01:45:28.731000', 1, 1),
	(7, 'Profil Kesehatan Kabupaten Barru 2022', '4201003.7310', '73100.2329', '- ', '2023-12-29', 'Profil Kesehatan Kabupaten Barru merupakan publikasi yang menyajikan gambaran umum kesehatan penduduk di Kabupaten Barru. Informasi yang disajikan dalam publikasi ini berasal dari hasil Survei Sosial Ekonomi Nasional Susenas) yang dilaksanakan bulan Maret oleh BPS setiap tahunnya. Pada publikasi ini dapat diperoleh informasi mengenai angka kesakitan, penggunaan jaminan kesehatan, kebiasaan merokok, kesehatan ibu dan bayi, serta keluarga berencana.', '2024-05-28 01:31:01.500000', '2024-05-28 01:51:12.545000', '2024-05-28 01:51:12.540000', 1, 1),
	(8, 'Statistik Kesejahteraan Rakyat Kabupaten Barru 2023', '4101002.7310', '73100.2328', '2598-1846', '2023-12-28', 'Publikasi Statistik Kesejahteraan Rakyat Tahun 2023 ini menggambarkan kondisi penduduk Kabupaten Barru dalam bidang Kependudukan, Pendidikan, Kesehatan, Fertilitas dan KB, Perumahan,Penggunaan teknologi infromasi dan komunikasi, Program perlindungan sosial yang diterima penduduk, Aset yang dimiliki, dan Konsumsi rata-rata penduduk Kabupaten Barru. Selain itu juga ditambahkan informasi tentang Potensi Kapabilitas Dasar Penduduk Kabupaten Barru yang berisi tentang ulasan Angka Partisipasi Sekolah Penduduk Kabupaten Barru.', '2024-05-28 01:34:25.501000', '2024-05-28 01:52:15.062000', '2024-05-28 01:52:15.058000', 1, 1),
	(9, 'Indikator Ekonomi Kabupaten Barru Tahun 2018-2022', '9201001.7310', '73100.23267', '-', '2023-12-21', 'Indikator Ekonomi Kabupaten Barru Tahun 2018-2022 merupakan sebuah publikasi yang meyajikan berbagai indikator tentang kegiatan perekonomian di Kabupaten Barru selama tahun 2018-2022. Publikasi ini dikemas dalam infografis yang dapat memberikan kemudahan bagi pengguna data dalam menginterpretasikan data atau informasi perekonomian. Berbagai data yang dirilis dalam publikasi ini antara lain meliputi: nilai Produk Domestik Regional Bruto (PDRB), inflasi, pengangguran, Indeks Pembangunan Manusia (IPM) dan kemiskinan.', '2024-05-28 01:35:52.177000', '2024-05-28 01:44:28.975000', '2024-05-28 01:44:28.970000', 1, 1),
	(10, 'Hasil Pencacahan Lengkap Sensus Pertanian 2023 - Tahap I Kabupaten Barru', '5106043.7310', '73100.2326', '-', '2024-12-15', 'Publikasi ini memuat informasi mengenai penjelasan umum Sensus Pertanian 2023, rumah tangga usaha pertanian dan klasifikasi usaha pertanian, demografi pengelola usaha pertanian, lahan pertanian dan penggunaan pupuk, petani gurem, petani milenial dan urban farming, serta komoditas pertanian.', '2024-05-28 01:42:33.795000', '2024-05-28 01:43:45.010000', '2024-05-28 01:43:45.004000', 1, 1),
	(11, 'Produk Domestik Regional Bruto Kabupaten Barru Menurut Pengeluaran 2019-2023', '9302020.7310', '73100.24005', '2797-5002', '2024-04-29', 'gljjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjjllllllllllllllk', '2024-05-28 14:14:49.539000', '2024-05-28 14:14:51.459000', '2024-05-28 14:14:51.448000', 1, 1);
